import React from 'react';
import {useHistory} from 'react-router-dom'
import {Keys} from "../../keys";
import './pageNotFound.scss';
 export const PageNotFound = (props: any) =>{
    const history = useHistory();
     const handle = () => {
        history.push(Keys.PAGE_LOGIN);
     }

     return <>
         <section id="not-found">
             <div id="title">Esta página no exite en el juego{"\n"}</div>
             <div id={"title"}>
                 {"\n"}Oprime el botón de abajo para ser redirigido a una parte existente en el juego... <em>¡Vamos!</em></div>
             <div className="circles">
                 <p>404
                     <small>PAGE NOT FOUND</small>
                 </p>
                 <span className="circle big"></span>
                 <span className="circle med"></span>
                 <span className="circle small"></span>
             </div>
         </section>
         </>
 };
